function bouncer(arr) {

  /*Remove all falsy values from an array.

  Falsy values in JavaScript are false, null, 0, "", 
  undefined, and NaN.*/

  let newArr=[];
  for (let i=0; i<arr.length; i++) {
    if (arr[i]) {
      newArr.push(arr[i]);
    }
  }

  return newArr;
}

